requests.postData:
{"query":"
            query Tournaments {
              tournaments(
                where: { competition: { is: { tier: { equals: 1 } } } }
              ) {
                clubTournaments(orderBy: { position: asc }) {
                  position
                  club {
                    id
                    name
                  }
                  clubStats {
                    points
                    games
                    wins
                    draws
                    losses
                    goals
                    goalsAgainst
                  }
                }
                competition {
                  name
                }
              }
            }
          ","operationName":"Tournaments"}
